import React from 'react';
import { Link } from 'react-router-dom';

const CuratorNavbar = () => (
  <nav style={styles.navbar}>
    <ul style={styles.navList}>
      <li style={styles.navItem}><Link to="/curator" style={styles.navLink}>Dashboard</Link></li>
      <li style={styles.navItem}><Link to="/curator/exhibition-highlights" style={styles.navLink}>Exhibition Highlights</Link></li>
      <li style={styles.navItem}><Link to="/curator/visitor-feedback" style={styles.navLink}>Visitor Feedback</Link></li>
      <li style={styles.navItem}><Link to="/curator/artwork-insights" style={styles.navLink}>Artwork Insights</Link></li>
      <li style={styles.navItem}><Link to="/curator/gallery-content-management" style={styles.navLink}>Gallery Content Management</Link></li>
      <li style={styles.navItem}><Link to="/curator/manage-artworks1" style={styles.navLink}>Manage Artworks</Link></li>
      <li style={styles.navItem}><Link to="/curator/organize-exhibitions" style={styles.navLink}>Organize Exhibition</Link></li>
    </ul>
  </nav>
);

const styles = {
  navbar: {
    backgroundColor: '#333',
    padding: '10px 20px',
    color: '#fff',
    borderBottom: '2px solid #444',
  },
  navList: {
    listStyle: 'none',
    display: 'flex',
    justifyContent: 'space-around',
    margin: 0,
    padding: 0,
  },
  navItem: {
    margin: '0 15px',
  },
  navLink: {
    color: '#fff',
    textDecoration: 'none',
    fontSize: '16px',
    fontWeight: '500',
    transition: 'color 0.3s',
  },
  navLinkHover: {
    color: '#ffcc00',
  },
};

export default CuratorNavbar;
